import React, {useState} from 'react';
import './style.css';

function TodoListNext() {
  const [inputValue, setInputValue] = useState('')
  const [isOpen, setIsOpen] = useState<boolean>()

  const handleClick = ()=>{
    setIsOpen(()=>!isOpen)
  }

  return (
    <div>
      <br />
      <button className="todoBtn" onClick={()=>{setInputValue('クリックした')}}>＋</button>
      {inputValue}
      <br />
      <br />
      <br />
      <button className="todoBtns" onClick={handleClick}><span className="material-icons-outlined">
edit
</span></button>
      {isOpen ? <div className="todolistForm">
        <label className="todoformlabel">
          <input type="text" placeholder="ここに書いてね" />
        </label>
      </div> : <p>ないよ</p>}
    </div>
  );
}

export default TodoListNext;
